    <script>
        const testModal = document.getElementById("testModal")
        const testModalClose = testModal.querySelector(".close-modal");
        const testBody = document.querySelector('body');
        const testOverlay = document.querySelector('.overlay');

        setTimeout(function () {
            testModal.classList.add('active');
            testOverlay.classList.add('active');
            testBody.classList.add('active');

            testModalClose.addEventListener("click", function () {
                testModal.classList.remove('active');
                testOverlay.classList.remove('active');
                testBody.classList.remove('active');
            });
        }, 4000)

        testModalClose.addEventListener('click', function (e) {
            fetch(this.dataset.url, {
                method: "POST",
                headers: {
                    "Content-type": "application/json; charset=UTF-8",
                    "Accept": "application/json",
                    "X-CSRF-TOKEN": document.querySelector('meta[name="csrf-token"]').getAttribute('content')
                }
            });
        })
    </script>
